                <GoogleMapReact
                    bootstrapURLKeys={{ key: apikeys.GOOGLEKEY }}
                    defaultCenter={location}
                    defaultZoom={zoomLevel}
                >
                    <LocationPin
                    lat={location.lat}
                    lng={location.lng}
                    text={location.address}
                    />
                </GoogleMapReact>
                </div>
        </div>
    )
}

export default GoogleMap
